1.body:
This tutorial uses C++ as the host programming language. Slint also supports other programming languages like Rust or JavaScript . We recommend using our editor integrations for Slint for following this tutorial. Slint has an application template you can use to create a project with dependencies already set up that follows recommended best practices. Before using the template, you need a C++ compiler that supports C++ 20 and to install CMake 3.21 or newer. Clone or download template repository: git clone https://github.com/slint-ui/slint-cpp-template memory
cd memory The CMakeLists.txt uses the line add_executable(my_application src/main.cpp) to set src/main.cpp as the main C++ code file. Change the content of src/main.cpp to the following: // src/main.cpp #include "appwindow.h" // generated header from memory.slint int main(int argc, char **argv)
{ auto main_window = MainWindow::create(); main_window->run();
} Also in CMakeLists.txt the line slint_target_sources(my_application ui/appwindow.slint) is a Slint function used to add the appwindow.slint file to the target. Change the contents of ui/appwindow.slint to the following: // ui/appwindow.slint
export component MainWindow inherits Window { Text { text: "hello world"; color: green; }
} Configure with CMake: cmake -B build Note : When configuring with CMake, the FetchContent module fetches the source code of Slint via git. This may take some time when building for the first time, as the process needs to build the Slint runtime and compiler. Build with CMake: cmake --build build Run the application binary on Linux or macOS: ./build/my_application Windows: build\my_application.exe This opens a window with a green "Hello World" greeting. If you are stepping through this tutorial on a Windows machine, you can run it with my_application Screenshot of initial tutorial app showing Hello World

2.body:
With the skeleton code in place, this step looks at the first element of the game, the memory tile. It's the visual building block that consists of an underlying filled rectangle background, the icon image. Later steps add a covering rectangle that acts as a curtain. You declare the background rectangle as 64 logical pixels wide and tall filled with a soothing tone of blue. Lengths in Slint have a unit, here, the px suffix. This makes the code easier to read and the compiler can detect when you accidentally mix values with different units attached to them. Copy the following code into ui/appwindow.slint file, replacing the current content: component MemoryTile inherits Rectangle { width: 64px; height: 64px; background: #3960D5; Image { source: @image-url("icons/bus.png"); width: parent.width; height: parent.height; }
} export component MainWindow inherits Window { MemoryTile {}
} The code exports the MainWindow component so that the C++ code can access it later. Inside the Rectangle place an Image element that loads an icon with the @image-url() macro. The path is relative to the location of ui/appwindow.slint. You need to install this icon and others you use later first. You can download a pre-prepared Zip archive to the ui folder, If you are on Linux or macOS, download and extract it with the following commands: cd ui
curl -O https://slint.dev/blog/memory-game-tutorial/icons.zip
unzip icons.zip
cd .. If you are on Windows, use the following commands: cd ui
powershell curl -Uri https://slint.dev/blog/memory-game-tutorial/icons.zip -Outfile icons.zip
powershell Expand-Archive -Path icons.zip -DestinationPath .
cd .. This unpacks an icons directory containing several icons. Compiling the program with cmake --build build and running with the ./build/my_application opens a window that shows the icon of a bus on a blue background. Screenshot of the first tile

3.body:
In this step, you add a curtain-like cover that opens when clicked. You do this by declaring two rectangles below the Image, so that Slint draws them after the Image and thus on top of the image. The TouchArea element declares a transparent rectangular region that allows reacting to user input such as a mouse click or tap. The element forwards a callback to the MainWindow indicating that a user clicked the tile. The MainWindow reacts by flipping a custom open_curtain property. Property bindings for the animated width and x properties also use the custom open_curtain property. The following table shows more detail on the two states: open_curtain value: false true Left curtain rectangle Fill the left half by setting the width width to half the parent's width Width of zero makes the rectangle invisible Right curtain rectangle Fill the right half by setting x and width to half of the parent's width width of zero makes the rectangle invisible. x moves to the right, sliding the curtain open when animated To make the tile extensible, replace the hard-coded icon name with an icon property that can be set when instantiating the element. For the final polish, add a solved property used to animate the color to a shade of green when a player finds a pair. Replace the code inside the ui/appwindow.slint file with the following: component MemoryTile inherits Rectangle { callback clicked; in property <bool> open_curtain; in property <bool> solved; in property <image> icon; height: 64px; width: 64px; background: solved ? #34CE57 : #3960D5; animate background { duration: 800ms; } Image { source: icon; width: parent.width; height: parent.height; } // Left curtain Rectangle { background: #193076; x: 0px; width: open_curtain ? 0px : (parent.width / 2); height: parent.height; animate width { duration: 250ms; easing: ease-in; } } // Right curtain Rectangle { background: #193076; x: open_curtain ? parent.width : (parent.width / 2); width: open_curtain ? 0px : (parent.width / 2); height: parent.height; animate width { duration: 250ms; easing: ease-in; } animate x { duration: 250ms; easing: ease-in; } } TouchArea { clicked => { // Delegate to the user of this element root.clicked(); } }
} export component MainWindow inherits Window { MemoryTile { icon: @image-url("icons/bus.png"); clicked => { self.open_curtain = !self.open_curtain; } }
} The code uses root and self. root refers to the outermost element in the component, the MemoryTile in this case. self refers to the current element. The code exports the MainWindow component. This is necessary so that you can later access it from application business logic. Running the code opens a window with a rectangle that opens up to show the bus icon when clicked. Subsequent clicks close and open the curtain again.

4.body:
After modeling a single tile, this step creates a grid of them. For the grid to be a game board, you need two features: A data model : An array created as a C++ model, where each element describes the tile data structure, such as: URL of the image Whether the image is visible If the player has solved this tile. A way of creating multiple instances of the tiles. With Slint you declare an array of structures based on a model using square brackets. Use a for loop to create multiple instances of the same element. The for loop is declarative and automatically updates when the model changes. The loop instantiates all the MemoryTile elements and places them on a grid based on their index with spacing between the tiles. First, add the tile data structure definition at the top of the ui/appwindow.slint file: struct TileData { image: image, image_visible: bool, solved: bool,
} Next, replace the export component MainWindow inherits Window { ... } section at the bottom of the ui/appwindow.slint file with the following: export component MainWindow inherits Window { width: 326px; height: 326px; in property <[TileData]> memory_tiles: [ { image: @image-url("icons/at.png") }, { image: @image-url("icons/balance-scale.png") }, { image: @image-url("icons/bicycle.png") }, { image: @image-url("icons/bus.png") }, { image: @image-url("icons/cloud.png") }, { image: @image-url("icons/cogs.png") }, { image: @image-url("icons/motorcycle.png") }, { image: @image-url("icons/video.png") }, ]; for tile[i] in memory_tiles : MemoryTile { x: mod(i, 4) * 74px; y: floor(i / 4) * 74px; width: 64px; height: 64px; icon: tile.image; open_curtain: tile.image_visible || tile.solved; // propagate the solved status from the model to the tile solved: tile.solved; clicked => { tile.image_visible = !tile.image_visible; } }
} The for tile[i] in memory_tiles: syntax declares a variable tile which contains the data of one element from the memory_tiles array, and a variable i which is the index of the tile. The code uses the i index to calculate the position of a tile, based on its row and column, using modulo and integer division to create a 4 by 4 grid. Running the code opens a window that shows 8 tiles, which a player can open individually.

5.body:
This step places the game tiles randomly. Change the main function and includes in src/main.cpp to the following: // ... #include <random> // Added int main()
{ auto main_window = MainWindow::create(); auto old_tiles = main_window->get_memory_tiles(); std::vector<TileData> new_tiles; new_tiles.reserve(old_tiles->row_count() * 2); for (int i = 0; i < old_tiles->row_count(); ++i) { new_tiles.push_back(*old_tiles->row_data(i)); new_tiles.push_back(*old_tiles->row_data(i)); } std::default_random_engine rng {}; std::shuffle(new_tiles.begin(), new_tiles.end(), rng); auto tiles_model = std::make_shared<slint::VectorModel<TileData>>(new_tiles); main_window->set_memory_tiles(tiles_model); main_window->run();
} The code takes the list of tiles, duplicates it, and shuffles it, accessing the memory_tiles property through the C++ code. For each top-level property, Slint generates a getter and a setter function. In this case get_memory_tiles and set_memory_tiles. Since memory_tiles is a Slint array, it's represented as a std::shared_ptr<slint::Model> . You can't change the model generated by Slint, but you can extract the tiles from it and put them in a slint::VectorModel which inherits from Model. VectorModel lets you make changes and you can use it to replace the static generated model. Running this code opens a window that now shows a 4 by 4 grid of rectangles, which show or hide the icons when a player clicks on them. There's one last aspect missing now, the rules for the game.
